import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Header from "./components/Header";
import LoginPage from "./pages/LoginPage";
import ProfilePage from "./pages/ProfilePage";
import RegisterPage from "./pages/RegisterPage";
import { useState } from "react";

function App() {
  const defaultUsers = [
    {
      picture:
        "https://t3.ftcdn.net/jpg/03/46/83/96/360_F_346839683_6nAPzbhpSkIpb8pmAwufkC7c5eD7wYws.jpg",
      email: "hello@hello.lt",
      pass1: "qwerty",
      pass2: "qwerty",
    },
    {
      picture:
        "https://t3.ftcdn.net/jpg/03/46/83/96/360_F_346839683_6nAPzbhpSkIpb8pmAwufkC7c5eD7wYws.jpg",
      email: "bye@bye.lt",
      pass1: "qwerty",
      pass2: "qwerty",
    },
  ];
  const [getUser, setUser] = useState(defaultUsers);

  return (
    <div className="App">
      <div className="d-flex">
        <BrowserRouter>
          <Header />
          <div className="grow3">
            <Routes>
              <Route path="/login" element={<LoginPage getUser={getUser} />} />

              <Route
                path="/register"
                element={<RegisterPage getUser={getUser} setUser={setUser} />}
              />
              <Route
                path="/profile/:em"
                element={<ProfilePage getUser={getUser} />}
              />
            </Routes>
          </div>
        </BrowserRouter>
      </div>
    </div>
  );
}

export default App;
